import React, { useState } from "react";
import "./Menu.css";

const Menu = ({ array }) => {
  return (
    <div className="menu">
      <div className="line">CATEGORIES</div>
      {array.map(sectionName => (
        <div className="section">{sectionName}</div>
      ))}
      <div className="section">Poultry</div>
      <div className="section">Pork</div>
      <div className="section">Fish</div>
      <div className="section">Vegetarian</div>
      <div className="section">Salads</div>
    </div>
  );
};

export default Menu;
